import React from 'react';

function Contents(props) {
    return (
        <div id="contents" className="container">
            <h2 className="title">React Basic</h2>
            <hr/>
            <br/><button type="button" className="btn">버튼</button><br/>
        </div>
    );
}

export default Contents;
